    <div style={{ minHeight: "100vh", padding: "20px", backgroundColor: "#f5f5f5" }}>
      {/* Simple dashboard header */}
      <h1 style={{ marginBottom: "20px" }}>Dashboard</h1>

      {/* This renders the dashboard content */}
      <div>
        {/* We can render nested routes here if needed */}
      </div>
    </div>
  );
}
